        "BookingItem:4264898": {
          __typename: "BookingItem",
          apolloCacheId: null,
          id: 4264898,
          businessId: 388888,
          name: " [매일11:30~19:00\u002F3~4인] 진심룸 예약",
          isNPayUsed: true,
          postPaid: false,
          isSelfService: false,
          isOrderAvailable: null,
          desc: "예약은 3인 이상부터 가능합니다.\n예약이 안 되시는 분들은 아래 펼쳐보기를 눌러 이용안내를 받으세요.\n\n\u003C이용시간\u003E\n\n런치 1부 : 11:30 ~ 12:50\n런치 2부 : 13:00 ~ 15:00\n디너 1부 : 17:00 ~ 18:50\n디너 2부 : 19:00 ~ 21:00\n\n1) 3~4인 팀이라면! 웨이팅 없이 안락하게 룸에서!\n\n진심룸 예약은 3~4인 팀만 가능합니다. 3인 이상 단체고객이 오래 기다리시는 경우가 많아, 예약은 3인 이상만 받고 있는 점 양해 바랍니다. \n\n2) 예약 없이 오셔도 식사하실 수 있습니다!\n\n일부만 예약석으로 운영하고 있어 예약이 마감되어도 자리가 있을 수 있습니다. 1~2인 고객을 포함해 예약을 놓치거나 할 수 없는 분들은 매장으로 바로 오시면 됩니다.\n\n3) 웨이팅이 있는 시간대에 오래 기다리지 않으려면!\n\n웨이팅이 있는 시간대에는 캐치테이블 원격 줄서기 기능(캐치테이블 어플에서 '스시도쿠'로 검색)을 이용해 오래 기다리지 않고 입장할 수 있습니다. 원격 웨이팅 기능은 앞선 웨이팅이 2팀 이상 있어야 원격 웨이팅 기능이 실행되며, 3인 이상 단체고객도 이용에 제한이 없습니다.\n\n4) 네이버 페이로 결제하신 예약금 1만원은 식사금액에서 차감되어 결제됩니다. 혹은, 방문 후 예약금 취소 후 카드 등 다른 결제수단으로 전액결제도 가능합니다.\n\n5) 5인 이상 단체 예약 및 매장 대관은 전화로 문의하시면 친절하게 안내해 드립니다.",
          precautionMessage:
            "서울에서 가장 사랑받는 스시, 한해 23만명이 방문하는 스시도쿠의 특별기획 100% 예약제! 웨이팅 없이 룸에서 편하게 모시겠습니다.\n\n* 네이버 페이로 결제하신 예약금 1만원은 식사금액에서 차감되어 결제됩니다. 혹은, 방문 후 예약금 취소 후 카드 등 다른 결제수단으로 전액결제도 가능합니다.\n\n* 예약취소시 예약금은 방문 3일전까지 100% 환불해드립니다. 방문 2일전 9,000원 환불, 방문 1일전 5,000원 환불해 드리지만 방문 당일은 환불 불가입니다.",

            'description({"source":["shopWindow"]})':
              "*서울에서 가장 사랑받는 스시는?\n\n스시도쿠는 대한민국 스시 일반단일매장 4,852개 중 네이버검색 1등입니다. 도대체 왜? 어째서!\n\n국내수급가능한 최상의 재료를 일식정통숙성, 당일재료당일소진 원칙으로 2~3배 크기의 횟감을 올려드리는 막강한 스시이기 때문에! 수도권 최강의 가성비와 맛성비이기 때문에! 맛집 없이는 완성되지 않는 데이트와 기념일을 장식하는 최선의 센스, 그것은 스시도쿠 예약!\n\n*스시도쿠의 2023년 3대 뉴스\n1) 한해 23만명이 방문하는 서울에서 가장 사랑받는 스시\n2023년은 고객님들의 사랑이 23만번 저희에게 닿았던 한해였습니다. 많이 남기지 않습니다. 많이 팝니다. 서울에서 가장 사랑받는 스시도쿠는 서울에서 가장 어리석게 장사하는 맛집입니다. 설레는 사람과 더 특별해지고 싶은 날, 서울에서 가장 사랑받는 스시로 사랑의 분위기를 완성하세요. 사랑에는 이유가 있습니다.\n\n2) 배민 찜 2만개, 모든 업종 모든 가게 전국 1등!\n배민입점 약 30만개 음식점 전 업종 통틀어 찜 전국 1등! 스시도쿠의 맛은 매장에서도 배달포장에서도 정확히 같은 사람, 같은 재료, 같은 신선함으로 빚어냅니다.\n\n3) 유명 푸드유튜브 채널에 4번 등장, 총 조회수 5천만회 돌파!\n스시도쿠는 연어, 참치, 광어 등 모든 활어를 정통 일식 제법대로 곤부지메 및 저온 숙성하며, 어종별로 다른 제법과 숙성시간을 지킵니다. 같은 가격대에서는 아무도 하지 않는 노력, 서울 1등의 자부심. 제법은 상세한 촬영으로 국내외에 모두 영상이 공개된 상태입니다. 유튜브에서 간단한 검색으로 100%라이브와 당일재료당일소진! 눈으로 확인하세요!\n\n*왕십리,한양대에 오시면, 스시도쿠!\n\n주소: 서울시 성동구 행당동196-23\n\n1) 왕십리역사 CGV에서 영화보고 엔터식스,이마트,비트플렉스몰에서 쇼핑하고 걸어서 5분 만에 도착! 한양대병원에서 도보 10분 거리!\n\n2) 왕십리역 7번출구에서 도보 7초거리이며, 서울숲 삼부아파트에 2시간 무료주차\n\n*놓치면 억울한 스시도쿠 시그니처메뉴 4가지\n\n기특함 가득찬 특품스시\n\n1년에 무려 9만 접시가 팔리는 스시도쿠의 베스트셀러\n\n일품술상 사시미\n\n일식정통 숙성회에 특제 해초와사비와 아귀간을 곁들여 바다의 향긋함이 감도는 감태에 싸 먹는 독보적인 경험\n\n8개한정한손가득 대왕스시\n\n가장 좋은 재료와 솜씨로 쌓은 스시의 성! 저녁5시부터 하루8개만 한정판매하는 크고 아름다운 스시\n\n작품스시와 13품사시미특정식\n\n스시에 더해 100% 셰프 수제로 구성해 올린 일등품 사시미와 해물, 국물, 누들, 그리고 츠케모노. 밥상과 술상 모두를 공략합니다.\n\n*스시도쿠 이용 4가지 꿀팁!\n\n1) 이벤트에 참여하면 1인당 고급스시 4pc씩 추가득템!\n2) 웨이팅이 생기면 캐치테이블 원격줄서기\n3) 3인 이상부터 네이버\u002F캐치테이블 룸예약\n4) 네이버플레이스 하이볼1+1쿠폰 쓰면 하이볼 1잔에 4천원! 개꿀!\n\n* 예약없이 오셔도 식사할 수 있습니다. 1~2인 고객을 포함해 예약을 할 수 없거나 놓친 분들은 현장으로 바로 오시면 됩니다.\n\n*초밥, 좋아하시나요?\n\n스시도쿠 사장인 저, 손영래는 누구보다 일식을 좋아한다고 자부하는 매니아입니다. 어렸을 때 일본에 수산물을 수출하시는 할아버지를 따라 일본의 고급초밥집을 많이 다녔는데, 할아버지가 돌아가시고 제 돈으로 스시를 먹으려고 하니 호텔 일식레스토랑, 오마카세는 너무 비쌌고, 새로운 트렌드였던 캐쥬얼스시의 퀄리티는 아쉬웠습니다.\n\n그래서 저는 결국 10년 전 제가 먹고 싶은 스시집을 차리자는 마음으로 스시도쿠를 오픈했습니다. 합리적인 가격의 고급초밥집을 꼭 만들고 싶었습니다. 자금이 부족해 반지하에서 출발했지만 10년동안 열심히 하다보니 어느덧 한 해 23만명이 찾아주시는 서울에서 가장 사랑받는 지금의 스시도쿠까지 오게 되었습니다. 이익을 남기기가 쉽지 않아 힘들지만 그래도 많은 손님들이 남아주신 것만으로도 다행이라고 생각합니다.\n\n앞으로도 스시도쿠를 오픈한 이유를 잊지않고 운영해 나갈 것을 약속합니다. 스시를, 일식을 좋아하신다면 스시도쿠라는 이름을 기억해주세요!",
          },
